script: |
  super -f text -I q3549.spq | sort > q3549.out

inputs:
  - name: q3549.spq
    data: |
      SELECT ALL + 77 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( 91 ) BETWEEN 2 AND NULL AND NOT - 29 * + ( 73 / - col1 ) IS NOT NULL;
  - name: tab2

outputs:
  - name: q3549.out
    data: |
